uint8_t Menu(void){
	uint8_t MultiIndex=0;
	uint8_t SongDelay=9;
	uint8_t TogleStart=0;
	int FlashDelay=40;
	
	typedef const struct Song{
		uint8_t size;
		uint8_t Repeat;
		uint16_t notes[200];
	}Stype;
	
	
	Stype Song[1]={
		{164, 1, {E, E, E, E, G, G, E, E, E, E, G, G, C4, C4, C4, C4, C4, C4, 0, C4, C4, A3, C4, C4, D, D, E, E, C4, C4, E, E, E, E, G, G, E, E, E, E, G, G, C4, C4, C4, C4, C4, C4, 0, C4, C4, A3, C4, C4, D, D, E, E, 0, 0, 
		C4, C4, C4, C4, F, F, A, A, A, A, A, A, A, A, G, G, G, G, E, E, C4, C4, C4, C4, C4, C4, C4, C4, F, F, F, F, E, E, B3, B3, B3, B3, B3, B3, D, D, E, E, E, E, D, D, C4, C4, C4, C4, C4, 0, 0,
		C4, C4, C4, C4, F, F, A, A, A, A, A, A, A, A, G, G, G, G, E, E, C4, C4, C4, C4, C4, C4, 0, 0, A3, A3, 0, A3, A3, 0, 0, A3, A3, C4, C4, A3, A3, G, G, G, 0, 0, 0}}
		};
	
	
	ST7735_DrawBitmap(13,60,Splatoon,100, 53);
	ST7735_FillRect(0,150,128, 160, 0x0000);
	ST7735_FillRect(0,0,128, 10, 0x0000);
	ST7735_FillRect(0,0,128, 10, 0x0000);

	
	while(1){
		Sound_Play(Song[0].notes[MultiIndex]);
			
			if(SongDelay==0){
			SongDelay=9;
			MultiIndex++;
			}
			
			SongDelay--;
			
			if(MultiIndex==(Song[0].size)&&(Song[0].Repeat))
				MultiIndex=0;
		
	if((GPIO_PORTD_DATA_R&0x01)!=0){
		
		while((GPIO_PORTD_DATA_R&0x01)!=0){}
		ST7735_FillScreen(0x0000);
		return 0;
	}
	
	
	ST7735_SetCursor(5,0);
		
	if(TogleStart)
		ST7735_OutString("Press Start");

	
	else
		ST7735_OutString("           ");
	
	
	FlashDelay--;

	if(FlashDelay==0){
		FlashDelay=40;
		TogleStart=(TogleStart+1)%2;
	}
	
	if((GPIO_PORTD_DATA_R&0x02)!=0){
		
		while((GPIO_PORTD_DATA_R&0x02)!=0){}
		
		return 1;
			}


		}
}


